import React from "react";

const Search = () => {
  return (
    <div className="container">
      <form className="form">
        <div class="form-group">
          <input
            type="text"
            name="text"
            value=""
            class="form-control"
            placeholder="Search Breweries..."
          />
          <input
            type="submit"
            value="Search"
            className="btn btn-dark btn-block"
          />
        </div>
      </form>
    </div>
  );
};

export default Search;
